.overflowingText {
  overflow: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
  display: block;
}
.pulseChart {
  font-family: "Segoe UI", "wf_segoe-ui_normal", helvetica, arial, sans-serif;
  stroke: none;
  stroke-width: 1px;
  outline: none;
}
.pulseChart .axisGraphicsContext {
  font-family: "Segoe UI", "wf_segoe-ui_normal", helvetica, arial, sans-serif;
  font-size: 11px;
}
.pulseChart .axis path,
.pulseChart .axis line {
  fill: none;
  stroke: #777777;
  shape-rendering: crispEdges;
}
.pulseChart .line {
  fill: none;
  stroke: steelblue;
  stroke-width: 2px;
}
.pulseChart .xAxisNode {
  font-size: 11px;
}
.pulseChart .xAxisNode line {
  display: none;
}
.pulseChart .xAxisNode text {
  fill: white;
}
.pulseChart .y {
  font-size: 11px;
}
.pulseChart .y g.tick line {
  opacity: 0.2;
}
.pulseChart .gaps .gap .gapNode {
  fill: dimgrey;
}
.pulseChart .animationPlay,
.pulseChart .animationPause,
.pulseChart .animationReset,
.pulseChart .animationPrev,
.pulseChart .animationNext,
.pulseChart .animationToEnd {
  cursor: pointer;
}


